import React from 'react';
import ReactDOM from 'react-dom';
import store from './store'
import './index.css';
import App from './App';
import { Provider } from 'react-redux'

store.subscribe(() => console.log(store.getState()))
ReactDOM.render(
    <Provider>
        <App />
    </Provider>
    , document.getElementById('root'));
